import React from 'react'
import SearchResult from './SearchResult'

class SearchList extends React.Component {
    render() {
		const searchResults = this.props.searches.map(item => <SearchResult key = {item.id} bookName={item.bookName} bookAuthor={item.bookAuthor} />)

        return (
            <div className = "app">
                {searchResults}
            </div>
		);
		var ItemNode = this.state.data.map(function(itemData) {
			return (
			   <ComponentName title={itemData.title} key={itemData.id} number={itemData.id}/>
			);
		});
	}
}
export default SearchList
